import React from "react";
import { SidebarContainer, Icon, CloseIcon } from "./SidebarElement";

const Sidebar = () => {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon>
        </CloseIcon>
      </Icon>
      <SidebarWrapper>
          <SidebarMenu>
              <SidebarLink to="about">
                  About
              </SidebarLink>
              <SidebarLink to="about">
                  About
              </SidebarLink>
              <SidebarLink to="about">
                  About
              </SidebarLink>
              <SidebarLink to="about">
                  About
              </SidebarLink>
          </SidebarMenu>
      </SidebarWrapper>
    </SidebarContainer>
  );
};

export default Sidebar;
